class CrearConcecutivo extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    
    render() { 
        return ( 
            <>
                <form>
                    <div className="row">
                        <div className="col">
                            <label htmlFor="" className="form-label">
                                Numero de concecutivo
                            </label>
                        </div>
                        <div className="col"></div>
                    </div>
                    
                    <input className="form-control" type="text" />
                </form>
            </>
        );
    }
}
export default CrearConcecutivo;
